import { Link } from "react-router-dom";
import '../../styles/trader.css'
import Charmaleon from '../../assets/charmaleon.png'
import TradeIcon from '../../assets/tradeIcon.png'
import Player1 from '../../components/Player1'
import Player2 from '../../components/Player2'

const TradePage = () => {
    const VerifyQuantityPokemon = () => {
        if(Player1.numPokemonTrade.quantity.length < 1 || Player1.numPokemonTrade.length > 6){
            alert("Selecione 1 até 6 pokémons");
        }
    }

    return(
        <div className="TraderGlobalContent">
            <Player1/>
            <div className="TraderImgs">
                <img alt="Charmandr Pokemon" src={Charmaleon}/>
                <Link 
                    style={{ textDecoration: "none" }} 
                    to={{ pathname: "/result" }}
                >
                    <button onClick={VerifyQuantityPokemon}><img alt="Changes " src={TradeIcon}/></button>


                </Link>
            </div>
            <Player2/>
        </div>
    )
}

export default TradePage;
